import React from 'react'

function MapTile(props) {
    return <div></div>
}

function Map(props) {
    return (
        <div 
            style={{
                width: '800px',
                height: '400px',
                backgroundColor: 'green',
                border: '4px solid white',  
            }}
        >
            {props.tiles.map(row => <MapRow tiles={row}/>)}
        </div>
    )
}

export default Map
